import React from 'react';
import ReactDOM from 'react-dom';
import Register from './Register';

const App = () => {
  return (
    <div className="outline">
      <h3>Crypto Sim</h3>
      <Register />
    </div>
  );
}

ReactDOM.render(<App />, document.querySelector('#root'));
